In the last 10 years or so as I've done a lot travel for work, I've had a capsule wardrobe-ish mentality without even really knowing or realizing it.  I say "ish" because I don't have a capsule wardrobe per se, but maybe I'd describe it as multiple small capsules like this one.⁣⁣
⁣⁣
Stemming from the desire to pack light when traveling for work, I have enjoyed grouping items that can be mixed and layered for a variety of occasions while taking up a small footprint. ⁣⁣
I also love to mix old and new and come up with new outfits or reorganize the small groups.  I'll list what I'm wearing here, but a lot of these things are older than this season (and some you might recognize from my Spring video) so hopefully this just gives you some outfit inspo to find new combos in your own wardrobe, or to rock a fun pair of colorful pants! ⁣⁣
