I had so much fun sharing some of my style recently and thank you all for your kind words and encouragement!  I enjoyed switching things up on my page, and thanks to your votes in my stories, I decided to occasionally share style posts. 
I love to mix and match, especially when I'm traveling because I like to travel lean!  It's so much easier to pack items that all go together so you can mix them for multiple outfits.  A few basics like a white tank/t-shirt jeans are my favorite - easy to layer (chambray shirt 🙌), easy to dress up or down and fun to pair with a unique item like a colorful skirt or statement jewelry.  The weather this time of year in Colorado can have crazy temperature swings so I always have a sweatshirt or jean jacket to layer. 
I'm loving this green tagua necklace, it has been so fun to incorporate one of my favorite colors!  Thank you to @irmaguzmanecojewelry  for sending it to me!  Check out her Etsy shop, link in her bio ❤️ If you're interested in what I'm wearing, here are the details, but hopefully this will give you some ideas of different ways to style basic items you already have!  Shopping is fun, but you don't need to buy all new to have fun with your wardrobe.

